artApp.controller('registrationCtrl',['$scope','$http', '$location', function($scope, $http, $location) {

    $scope.tab = 1;
    $scope.district = false;

    $scope.isSet = function(checkTab) {
        return $scope.tab === checkTab;
    };

    $scope.setTab = function(setTab) {
        $scope.tab = setTab;
    };


    $http.get('template/country.json').success(function(data){
        $scope.country = data;
        //console.log($scope.country);
    });


    $scope.change = function () {
        //alert($scope.data.country);
        if ($scope.user.country === 'Україна') {
            $scope.district = true;

            $http.get('template/ukraine-district.json').success(function(data){
                $scope.ukraineDistrict = data;
                //console.log($scope.country);
            });

        }
        else {
            $scope.district = false;
        }
    };


    var arrDay = [];

    for (var i = 1; i <= 31; i ++) {
        arrDay[i] = i;
    }

    $scope.arrayDay = arrDay;

    $scope.arrayMonth = [
          "Січня"
        , "Лютого"
        , "Березня"
        , "Квітня"
        , "Травня"
        , "Червня"
        , "Липня"
        , "Серпня"
        , "Вересня"
        , "Жовтня"
        , "Листопада"
        , "Грудня"
    ];

    $scope.arrayYear = [
          1979
        , 1980
        , 1981
        , 1982
        , 1983
        , 1984
        , 1985
        , 1986
        , 1987
        , 1988
        , 1989
        , 1990
        , 1991
        , 1992
        , 1993
        , 1994
        , 1995
        , 1996
        , 1997
        , 1998
        , 1999
        , 2000
    ];


    $scope.exhibition = function(status) {
        if (status == 'on') {
            $scope.exhibition = true;
        }
        else {
            $scope.exhibition = false;
            user.exhibitionText = null;
        }
    }

}]);

